import React from 'react';
import styles from "./Header.module.css"
import {UilLuggageCart} from "@iconscout/react-unicons";

type navElementsType = {
    id: number,
    title: string
}

const Header = () => {

    const navElements: navElementsType[] = [
        {id: 1, title: "Home"},
        {id: 2, title: "About Me"},
        {id: 3, title: "Projects"},
        {id: 4, title: "Contacts"}
    ]

    const navRender:JSX.Element[] = navElements.map((el:navElementsType) => {
        return (
            <li key={el.id}> {el.title} </li>
        )
    })

    return (
        <div className={styles.headerWrapper}>
            <div className={styles.headerContainer}>
                <div className={styles.leftHeaderContainer}>
                    <h3>
                        Danila-Beep
                    </h3>
                    <div className={styles.verticalLine}/>
                    <nav className={styles.headerNavigation}>
                        <ul>
                            {navRender}
                        </ul>
                    </nav>
                </div>
                <div className={styles.rightHeaderContainer}>
                    <UilLuggageCart size={35} className={styles.logo}/>
                </div>
            </div>
        </div>
    );
};

export default Header;
